  faUserInjured,
  faGripHorizontal,
  faSignOutAlt,
  faCogs,
} from "@fortawesome/free-solid-svg-icons";
const SideBar = () => {
  return (
    <div className="sidenav px-2 py-5">
      <div className="side-item">
        <Link to="/dashboard">
          <button className="my-md-3">
            <FontAwesomeIcon icon={faGripHorizontal} /> DashBoard
          </button>
        </Link>
